package com.hpcl.inout.repository;import java.util.List;import org.springframework.data.jpa.repository.JpaRepository;import org.springframework.data.jpa.repository.Query;import com.hpcl.inout.entity.Officer;public interface OfficerRepository extends JpaRepository<Officer, Long> {  Officer findByUniqueId(String paramString);    @Query("SELECT o.fullName FROM Officer o WHERE o.fullName IS NOT NULL")  List<String> findFullNames();}